import React from "react";
import './index.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faMagnifyingGlass, faBagShopping, faUser } from '@fortawesome/free-solid-svg-icons';

const Nav = () => {
    return (
        <div class="grid-rows-1 bg-gray-200">
            <span class="font-extrabold text-left">FlavZ</span>
            <span>
                <a href="/">Recipies</a>
                <a href="/">About Us</a>
                <a href="/">Contact</a>
            </span>
            <span>
                <a href="#"><FontAwesomeIcon icon={faMagnifyingGlass} /></a>
                <a href="#"><FontAwesomeIcon icon={faBagShopping} /></a>
                <a href="#"><FontAwesomeIcon icon={faUser} /></a>
            </span>
        </div>
    );
}

export default Nav;
